INSERT INTO `smeoa_daily_report` VALUES ('219', '1', '管理员', '27', '浙江神洲酷奇科技发展有限公司', '1472102516', '时听到过的人', '1、新华网北京8月25日电  八月的青海高原，天高气爽。22日至24日，习近平总书记深入青海海西蒙\r\n2、古族藏族自治州、海东市、西宁市等地调研考察，就贯彻落实“十三五”规划纲要、推进脱贫攻坚工作\r\n3、推动生态文明建设走访了农村牧区、企业、环保科研单位。循着考察足迹，记者回访了和总书记面对面交流的部分干部群众。', '', '1、一场透雨洗过的戈壁新城格尔木市，空气中散发着泥土的清香。位于市郊的藏族村庄三江源生态移民新村、\r\n2、长江源村，沉浸在幸福和喜悦之中。两天前，习总书记来这里考察调研，令当地干部群众倍受鼓舞。', '0', '1', '', null, null, null, null, null, null, null, null, null, '2016-08-25');
