INSERT INTO `smeoa_daily_report` VALUES ('258', '1', '管理员', '3', '技术部', '1473652170', '今日工作内容：\r\n 1、9月转正员工跟进：仓配一部：9人（转正时间：9月15日）；仓配二部：4人（转正时间未确定）；其中有6人申请试用期间社保不补缴，已电话确认\r\n 2、提成理赔跟进：数据还在审核中\r\n 3、离职人员手续办理跟进：张涛：明日办理手续 ；毕嘉：电话无人接听，明天继续跟进；张志新：仓配中心经理确认9月14日办理离职 \r\n4、工资再次核查 \r\n5、花名册、通讯录更新---已完成，明日发群里\r\n 6、行政人事表单再次确认---发邮箱 7、电话通知仓库人员市民卡办理资料准备----已通知，如未准备或者人员不足10人，将办理不了，原网上审核名单共有13人\r\n 8、工资核算相关明细整理（6-8月）---发邮箱 9、卢伟伟4月社保补缴资料准备----劳动合同、工资凭证已完成', 'w', 'w', 'w', '0', '1', '', null, null, null, null, null, null, null, null, null, '2016-09-12');
INSERT INTO `smeoa_daily_report` VALUES ('259', '1', '管理员', '3', '技术部', '1473652251', '1，安装Python\r\n\r\nPython是一个跨平台语言，Python从3.0的版本的语法很多不兼容2版本，官网找到最新的版本并下载：http://www.python.org， 因为之前的一个项目是2版本开发的，故下载了2.7\r\n\r\n \r\n\r\n2，在Windows命令行中使用Python\r\n\r\n如果你想要从Windows命令行调用Python，那么需要先设置Python环境变量。\r\n\r\n编辑PATH环节便利将;D:\\dev\\python2.7.11加到它的结尾。当然，是Python所在的安装目录。', '1', '', '1', '0', '1', '', null, null, null, null, null, null, null, null, null, '2016-09-12');
