INSERT INTO `smeoa_flow_confirm_setting` VALUES ('1', '51', 'getParentid', '<tr>\r\n    <td width=\"12%\" height=\"140\" align=\"center\">部门领导意见</td>\r\n    <td style=\"padding-left:5px;\" height=\"140\" colspan=\"7\">\r\n    <p>综合评述：</p><textarea id=\"dept_leader_review\" name=\"dept_leader_review\" onchange=\"setDeptLeaderReview($(\'#dept_leader_review\').val(),{$vo.id},{$vo.flow_id})\" <if condition=\"($flow_index.1 neq 1)\">disabled<else/> check=\"require\" msg=\"请填写综合评述\"</if> style=\"outline:none; border:none; resize:none; width:99%;\" rows=\"3\">{$vo.dept_leader_review}</textarea>\r\n    <p>建议自{$flow_index[1]}<input id=\"dept_leader_date\" name=\"dept_leader_date\" value=\"{$vo.dept_leader_date}\" onchange=\"setDeptLeaderDate($(\'#dept_leader_date\').val(),{$vo.id},{$vo.flow_id})\" <if condition=\"($flow_index.1 neq 1)\">disabled<else/> check=\"require\" msg=\"请填写执行日期\"</if> data-date-format=\"yyyy-mm-dd\" style=\"outline:none; border:none; padding-left:10px;\" type=\"text\" class=\"form-control input-date-time\"/>起执行</p>\r\n    <p style=\"margin-left:70%;\">签字/日期：<input <if condition=\"($flow_log_all[0])\"> value=\"{$flow_log_all[0].user_name}/{$flow_log_all[0].create_time|toDate=\'Y-m-d\'}\"</if> style=\"outline:none; border:none; width:66%; text-align:center;\" type=\"text\" disabled/></p>\r\n			</td>\r\n  </tr>');
INSERT INTO `smeoa_flow_confirm_setting` VALUES ('2', '51', 'getDeptManagerId', '<tr>\r\n    <td width=\"12%\" height=\"140\" align=\"center\">部门总监意见</td>\r\n    <td style=\"padding-left:5px;\" height=\"140\" colspan=\"7\">\r\n    <p>综合评述：</p><textarea id=\"dept_director_review\" name=\"dept_director_review\" onchange=\"setDeptDirectorReview($(\'#dept_director_review\').val(),{$vo.id},{$vo.flow_id})\" <if condition=\"($flow_index.1 neq 1)\">disabled<else/> check=\"require\" msg=\"请填写综合评述\"</if> style=\"outline:none; border:none; resize:none; width:99%;\" rows=\"3\">{$vo.dept_director_review}</textarea>\r\n    <p>建议自<input id=\"dept_director_date\" name=\"dept_director_date\" value=\"{$vo.dept_director_date}\" onchange=\"setDeptDirectorDate($(\'#dept_director_date\').val(),{$vo.id},{$vo.flow_id})\" <if condition=\"($flow_index.1 neq 1)\">disabled<else/>check=\"require\" msg=\"请填写执行日期\"</if> data-date-format=\"yyyy-mm-dd\" style=\"outline:none; border:none; padding-left:10px;\" type=\"text\" class=\"form-control input-date-time\"/>起执行</p>\r\n    <p style=\"margin-left:70%;\">签字/日期：<input <if condition=\"($flow_log_all[0])\"> value=\"{$flow_log_all[0].user_name}/{$flow_log_all[0].create_time|toDate=\'Y-m-d\'}\"</if> style=\"outline:none; border:none; width:66%; text-align:center;\" type=\"text\" disabled/></p></td>\r\n  </tr>');
INSERT INTO `smeoa_flow_confirm_setting` VALUES ('3', '51', 'getHRDeputyGeneralManagerId', '<tr>\r\n    <td width=\"12%\" height=\"100\" align=\"center\">人事行政部意见</td>\r\n    <td style=\"padding-left:5px;\" height=\"100\" colspan=\"7\">\r\n    <p style=\"padding-top:8px\">建议转正\r\n自<input id=\"hr_execute\" name=\"hr_execute\" value=\"{$vo.hr_execute}\" onchange=\"setHrExecute($(\'#hr_execute\').val(),{$vo.id},{$vo.flow_id})\" <if condition=\"($flow_index.3 neq 3)\">disabled<else/> </if> data-date-format=\"yyyy-mm-dd\" class=\"form-control input-date\"style=\"outline:none; border:none; padding-left:10px;\" type=\"text\" />起执行</p>\r\n        <p>建议延长试用期至\r\n        <input id=\"hr_add_date\" name=\"hr_add_date\" value=\"{$vo.hr_add_date}\" onchange=\"setHrAddDate($(\'#hr_add_date\').val(),{$vo.id},{$vo.flow_id})\" <if condition=\"($flow_index.3 neq 3)\">disabled<else/> </if>  data-date-format=\"yyyy-mm-dd\" class=\"form-control input-date\"  style=\"outline:none; border:none; margin-left:10px;\" type=\"text\"/>(三个月为限)</p>\r\n  \r\n   \r\n   <p>建议自<input id=\"hr_dismiss\" name=\"hr_dismiss\" value=\"{$vo.hr_dismiss}\" onchange=\"setHrDismiss($(\'#hr_dismiss\').val(),{$vo.id},{$vo.flow_id})\" <if condition=\"($flow_index.3 neq 3)\">disabled</if> data-date-format=\"yyyy-mm-dd\" class=\"form-control input-date\" style=\"outline:none; border:none; padding-left:10px;\" type=\"text\" />起辞退</p></td>\r\n    \r\n  </tr>');
