INSERT INTO `smeoa_flow_confirm_setting` VALUES ('13', '48', 'getDeptManagerId,getHRDeputyGeneralManagerId', '<tr>\r\n    <td width=\"13%\" colspan=\"4\"><p style=\"padding-left:10px;\" align=\"left\">部门总监意见：\r\n    <textarea style=\"width:98%\" rows=\"3\" id=\"directors_opinion\" name=\"directors_opinion\" disabled><if condition=\"($flow_log_all[0])\">{$flow_log_all[0].result|show_result}</if></textarea>\r\n    <p style=\"margin-left:60%;\">签名/日期: \r\n    	<input id=\"directors_sign_date\" name=\"directors_sign_date\" style=\"width:50%;\" type=\"text\" <if condition=\"($flow_log_all[0])\"> value=\"{$flow_log_all[0].user_name}/{$flow_log_all[0].create_time|toDate=\'Y-m-d\'}\"</if> disabled/></p>\r\n    </p>\r\n    </td>\r\n    <td colspan=\"4\"><p style=\"padding-left:10px;\" align=\"left\">人事行政部审核/审批意见：\r\n    	<textarea style=\"width:98%\" rows=\"3\" id=\"hr_opinion\" name=\"hr_opinion\" disabled><if condition=\"($flow_log[1])\">{$flow_log[1].result|show_result}</if></textarea>\r\n    <p style=\"margin-left:60%;\">签名/日期:\r\n    	<input id=\"hr_sign_date\" name=\"hr_sign_date\" style=\"width:50%;\" type=\"text\" <if condition=\"($flow_log[1])\"> value=\"{$flow_log[1].user_name}/{$flow_log[1].create_time|toDate=\'Y-m-d\'}\" </if> disabled/></p>\r\n    </p>\r\n    </td>\r\n  </tr>');
INSERT INTO `smeoa_flow_confirm_setting` VALUES ('14', '48', 'getGeneralManagerId', '<tr>\r\n    <td width=\"13%\" align=\"center\"><p align=\"center\">总经理</p>\r\n    <p align=\"center\">审核/审批</p></td>\r\n    <td colspan=\"7\"><textarea id=\"general_manager_opinion\" name=\"general_manager_opinion\" rows=\"3\" disabled><if condition=\"($flow_log[2])\">{$flow_log[2].result|show_result}</if></textarea>\r\n    	<div>是否需要参加复试：\r\n        	<input value=\"是\" style=\"width:2%;\" type=\"radio\" name=\"is_retrial\" onclick=\"setRetrial(1,{$vo.id},{$vo.flow_id})\" <if condition=\"($vo.is_retrial eq \'是\')\">checked=\"checked\"</if> <if condition=\"($flow_index.3 neq 3)\">disabled</if>/>是\r\n            <input value=\"否\" style=\"width:2%;\" type=\"radio\" name=\"is_retrial\" onclick=\"setRetrial(0,{$vo.id},{$vo.flow_id})\" <if condition=\"($vo.is_retrial eq \'否\')\">checked=\"checked\"</if> <if condition=\"($flow_index.3 neq 3)\">disabled</if>/>否\r\n        </div>\r\n    </td>\r\n  </tr>');
