INSERT INTO `smeoa_flow_confirm_setting` VALUES ('34', '50', 'getParentid', '<tr>\r\n    <td width=\"12%\" height=\"80\" align=\"center\">部门领导考核意见</td>\r\n    <td height=\"80\" colspan=\"7\">\r\n    <p style=\"padding-left:10px;\">综合评述：</p>\r\n    <textarea id=\"dept_leader_review\" name=\"dept_leader_review\" onchange=\"setDeptLeaderReview($(\'#dept_leader_review\').val(),{$vo.id},{$vo.flow_id})\" style=\" outline:none; border:none; resize:none; width:97%; padding-left:5px;\" rows=\"4\" <if condition=\"($flow_index.2 neq 2)\">disabled</if>>{$vo.dept_leader_review}\r\n    </textarea>\r\n    <p style=\"margin-left:70%;\">签字/日期：<input style=\"outline:none; border:none;\" type=\"text\"<if condition=\"($flow_log_all[0])\"> value=\"{$flow_log_all[1].user_name}/{$flow_log_all[1].create_time|toDate=\'Y-m-d\'}\"</if> disabled/></p>\r\n    <div style=\" margin-bottom:5px; padding-left:5px;\">\r\n    <input name=\"dept_leader_type\" style=\" margin-left:15px;\" type=\"radio\" onclick=\"setDeptLeaderType(\'正常转正\',{$vo.id},{$vo.flow_id})\" <if condition=\"($vo.dept_leader_type eq \'正常转正\')\">checked=\"checked\"</if><if condition=\"($flow_index.2 neq 2)\">disabled</if>/>正常转正\r\n    <input name=\"dept_leader_type\" style=\" margin-left:15px;\" type=\"radio\" onclick=\"setDeptLeaderType(\'提前转正\',{$vo.id},{$vo.flow_id})\" <if condition=\"($vo.dept_leader_type eq \'提前转正\')\">checked=\"checked\"</if><if condition=\"($flow_index.2 neq 2)\">disabled</if>/>提前转正\r\n    <input name=\"dept_leader_type\" style=\" margin-left:15px;\" type=\"radio\" onclick=\"setDeptLeaderType(\'调岗试用\',{$vo.id},{$vo.flow_id})\" <if condition=\"($vo.dept_leader_type eq \'调岗试用\')\">checked=\"checked\"</if><if condition=\"($flow_index.2 neq 2)\">disabled</if>/>调岗试用\r\n    <input name=\"dept_leader_type\" style=\" margin-left:15px;\" type=\"radio\" onclick=\"setDeptLeaderType(\'辞退\',{$vo.id},{$vo.flow_id})\" <if condition=\"($vo.dept_leader_type eq \'辞退\')\">checked=\"checked\"</if><if condition=\"($flow_index.2 neq 2)\">disabled</if>/>辞退\r\n    <input name=\"dept_leader_type\" style=\" margin-left:15px;\" type=\"radio\" onclick=\"setDeptLeaderType(\'建议延长试用\',{$vo.id},{$vo.flow_id})\" <if condition=\"($vo.dept_leader_type eq \'建议延长试用\')\">checked=\"checked\"</if><if condition=\"($flow_index.2 neq 2)\">disabled</if>/>建议延长试用\r\n    <input id=\"dept_leader_day\" name=\"dept_leader_day\" value=\"{$vo.dept_leader_day}\" onchange=\"setDeptLeaderDay($(\'#dept_leader_day\').val(),{$vo.id},{$vo.flow_id})\" style=\"outline:none; border:none; width:5%; text-align:center; border-bottom:1px #000 solid;\" type=\"text\" <if condition=\"($flow_index.2 neq 2)\">disabled</if>/>天\r\n    </div>\r\n    </td>\r\n  </tr>');
