INSERT INTO `smeoa_forum` VALUES ('41', '91', '1', '管理员', '[聚焦G20峰会8]杭州峰会将给G20带来哪些突破？', '<div class=\"adNoH600NoBor\" id=\"adSba_1\" style=\"margin:0px auto 40px;padding:0px;text-align:center;color:#2B2B2B;font-family:SimSun;\">\r\n	<ul class=\"adSbaList\">\r\n		<div id=\"ad_survey_ad_slot_9264\" style=\"margin:0px;padding:0px;border:0px;\">\r\n			<a></a>\r\n		</div>\r\n	</ul>\r\n</div>\r\n<div class=\"conText\" style=\"padding:0px;color:#2B2B2B;font-family:SimSun;\">\r\n	<h1 style=\"font-weight:normal;font-family:\'Microsoft YaHei\', SimHei;font-size:26px;color:#333333 !important;\">\r\n		[聚焦G20峰会8]杭州峰会将给G20带来哪些突破？\r\n	</h1>\r\n	<div class=\"summaryNew\" style=\"color:#8C8C8C;padding:7px 0px 9px;\">\r\n		<span class=\"timeSummary\" id=\"pubtime_baidu\" style=\"line-height:20px;vertical-align:middle;\">2016-08-25 09:59:00</span><span class=\"fromSummary\" id=\"source_baidu\" style=\"line-height:20px;vertical-align:middle;\"><a href=\"http://sike.news.cn/statics/sike/posts/2016/08/219504945.html\">新华网思客</a></span><span class=\"shareSummary\">分享<span></span>\r\n		<div class=\"bdsharebuttonbox bdshare-button-style0-24\">\r\n			<a href=\"http://china.huanqiu.com/article/2016-08/9357486.html?from=bdwz#\" class=\"bds_more\"></a><a href=\"http://china.huanqiu.com/article/2016-08/9357486.html?from=bdwz#\" class=\"bds_qzone\"></a><a href=\"http://china.huanqiu.com/article/2016-08/9357486.html?from=bdwz#\" class=\"bds_tsina\"></a><a href=\"http://china.huanqiu.com/article/2016-08/9357486.html?from=bdwz#\" class=\"bds_tqq\"></a><a href=\"http://china.huanqiu.com/article/2016-08/9357486.html?from=bdwz#\" class=\"bds_renren\"></a><a href=\"http://china.huanqiu.com/article/2016-08/9357486.html?from=bdwz#\" class=\"bds_weixin\"></a>\r\n		</div>\r\n</span><span class=\"txtChange\"><a class=\"txtSmallCur\" id=\"font14\"></a><a class=\"txtBig\" id=\"font16\"></a></span><span class=\"join\" style=\"background:#F5F5F5;\"><span id=\"msgNumBottom\" class=\"msgNum\" style=\"line-height:32px;font-family:Arial;font-size:14px;color:#2B9EBE;\"><a href=\"http://china.huanqiu.com/article/2016-08/9357486.html?from=bdwz#thread\">356</a></span><span style=\"line-height:32px;color:#FFFFFF;background:url(http://himg2.huanqiu.com/statics/images/icon4.png) no-repeat;\"><a href=\"http://china.huanqiu.com/article/2016-08/9357486.html?from=bdwz#thread\">参与</a></span></span>\r\n	</div>\r\n	<div class=\"text16\" id=\"text\" style=\"font-size:16px;margin:0px auto;\">\r\n		<p align=\"center\">\r\n			<img src=\"http://himg2.huanqiu.com/attachment2010/2016/0825/20160825100016947.jpg\" style=\"height:auto;\" />\r\n		</p>\r\n		<p align=\"center\">\r\n			为成功举办此次峰会，<a href=\"http://country.huanqiu.com/china\" class=\"linkAbout\" target=\"_blank\">中国</a>进行了周密的准备。\r\n		</p>\r\n		<p>\r\n			二十国集团（G20）领导人第十一次峰会将于9月4日至5日在杭州举行。中国希望通过举办杭州峰会实现以下目标：<strong>一是发挥G20的引领作用，体现战略远见和雄心，</strong>&nbsp;为世界经济指明方向，发掘动力；<strong>二是加强国际经济合作，发扬同舟共济的伙伴精神，</strong>&nbsp;共同应对风险和挑战，发出团结、开放、包容、合作的强有力信号；<strong>三是创新机制建设，打造合作平台，为G20从危机应对向长效治理机制转型提供坚实保障。</strong>\r\n		</p>\r\n		<p>\r\n			为成功举办此次峰会，中国进行了周密的准备。自2015年12月1日接任主席国以来，中国已经举行了三次G20协调人会议、三次财长与央行行长会议及副手会议，以及数十场各类工作组会议，G20成员从政治成果统筹和具体经济金融问题的应对两个方面达成了诸多共识。此外，贸易、能源、就业、农业等专业部长会议，以及B20、Y20、W20、L20、T20、C20等外围配套会议也已基本结束。这一系列会议为杭州峰会的召开提供了许多有益的建议，为峰会取得成功奠定了坚实的基础。\r\n		</p>\r\n		<p>\r\n			G20是当今世界讨论全球经济问题的首要平台，是目前为止最具代表性的全球经济治理机制。<strong>首先峰会的成功首先体现在能否在事关全球经济发展的问题上形成共识、确定目标、指明方向、发挥领导力，改变世界经济持续低迷的状况，为世界经济长期发展注入活力上。</strong>\r\n		</p>\r\n		<p>\r\n			世界经济长期低迷，既有缺乏新兴产业支撑、经济增长动力不足的因素，也有全球化背景下世界经济缺乏协调、缺乏公平的制度与规则、缺乏长远规划的因素，同时还有社会利益分配不均或经济发展不平衡引发贸易\r\n		</p>\r\n	</div>\r\n</div>', '49', '4', '0', '', '0', '1472103109', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('42', '92', '1', '管理员', '中石油上半年净利润5.31亿 缩水九成多', '<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	京华时报讯（记者施志军）昨晚，中石油发布了中期业绩报告。按国际财务报告准则，2016年上半年，集团实现营业额人民币7390.67亿元，比上年同期降低15.8%；归属母公司股东净利润人民币5.31亿元，同比去年大幅降低97.9%；实现每股基本盈利0.003元，比上年同期减少0.136元。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	报告期内，国际石油市场供需基本面宽松，受全球经济复苏缓慢、地缘政治等因素综合影响，国际原油价格探底后震荡回升，WTI原油与其他基准油价差进一步收窄。北海布伦特原油和WTI原油现货平均价格分别为39.81美元/桶和39.64美元/桶，比上年同期分别下降31.2%和25.6%。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	对于业绩大幅下滑，中国石油表示，主要是受原油、天然气、成品油等主要产品价格下降以及原油、天然气等产品销售量增加综合影响。油价下跌导致探明开发储量下降、折耗率上升，油气资产折耗增加。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	业内专家认为，这还是与国际油价的持续走低有关。卓创资讯成品油分析师秦文平表示，由于勘探与原油生产占到中石油业务收入的78％以上，所以，其受国际油价低位的冲击更明显。国内油田开采成本在45-53美元/桶，远高于当前国际油价。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	另外，中报还公布了一份人事最新动态，中石油集团董事会同意推举章建华为公司董事候选人，并同意将该议案提交公司2016年临时股东大会审议批准。\r\n</p>', '3', '0', '0', '', '0', '1472103140', '0', '0', '0');
