INSERT INTO `smeoa_forum` VALUES ('47', '91', '1', '管理员', '如何实现全民健康 习近平这样说', '<div class=\"hr-h5\" style=\"margin:0px;padding:0px;font-family:Simsun;background-color:#FFFFFF;\">\r\n</div>\r\n<div class=\"inner\" style=\"margin:0px;padding:0px 20px 10px 5px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	<div style=\"margin:0px;padding:22px 10px 0px 0px;\">\r\n		<div id=\"_urt1m620xw7y14i\" style=\"margin:0px;padding:0px;\">\r\n		</div>\r\n		<div id=\"BAIDU_SSP__wrapper_u2733820_0\" style=\"margin:0px;padding:0px;\">\r\n			<br />\r\n		</div>\r\n	</div>\r\n	<p style=\"font-size:14px;text-indent:30px;\">\r\n		“没有全民健康，就没有全面小康。”2016年8月26日，中共中央政治局召开会议，审议通过“健康中国2030”规划。习近平总书记主持会议并发表重要讲话。人民身体健康是全面建成小康社会的重要内涵，只有把人民健康放在优先发展战略地位，加快推进健康中国建设，才能为实现“两个一百年”奋斗目标、实现中华民族伟大复兴的中国梦打下坚实健康基础。\r\n	</p>\r\n	<p style=\"font-size:14px;text-indent:30px;\">\r\n		这些年，以习近平同志为总书记的党中央高度重视我国的卫生与健康问题：不仅关注身体健康，而且重视心理健康；不仅强调政府发力，而且提倡全民健身；不仅致力于发展我国的卫生与健康事业，而且积极履行国际义务、参与全球健康治理。关于卫生与健康问题，习近平总书记都作过哪些重要讲话？让我们一起来看。\r\n	</p>\r\n	<p style=\"font-size:14px;text-indent:30px;\">\r\n		全民健身 全民健康 全面小康\r\n	</p>\r\n	<p style=\"font-size:14px;text-indent:30px;\">\r\n		没有全民健康，就没有全面小康。要把人民健康放在优先发展的战略地位，以普及健康生活、优化健康服务、完善健康保障、建设健康环境、发展健康产业为重点，加快推进健康中国建设，努力全方位、全周期保障人民健康，为实现“两个一百年”奋斗目标、实现中华民族伟大复兴的中国梦打下坚实健康基础。\r\n	</p>\r\n	<p style=\"font-size:14px;text-indent:30px;\">\r\n		——2016年8月19日至20日，习近平在全国卫生与健康大会上说\r\n	</p>\r\n	<p style=\"font-size:14px;text-indent:30px;\">\r\n		没有全民健康，就没有全面小康。医疗卫生服务直接关系人民身体健康。要推动医疗卫生工作重心下移、医疗卫生资源下沉，推动城乡基本公共服务均等化，为群众提供安全有效方便价廉的公共卫生和基本医疗服务，真正解决好基层群众看病难、看病贵问题。\r\n	</p>\r\n	<p style=\"font-size:14px;text-indent:30px;\">\r\n		——2014年12月13日，习近平在江苏镇江市丹徒区世业镇卫生院考察时说\r\n	</p>\r\n	<p style=\"font-size:14px;text-indent:30px;\">\r\n		全民健身是全体人民增强体魄、健康生活的基础和保障，人民身体健康是全面建成小康社会的重要内涵，是每一个人成长和实现幸福生活的重要基础。\r\n	</p>\r\n</div>', '0', '0', '0', '', '0', '1472349195', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('48', '91', '1', '管理员', '李克强主持召开国务院常务会议', '<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	<strong>央视网消息</strong>&nbsp;（新闻联播）：国务院总理李克强8月24日主持召开国务院常务会议，部署促进消费品标准和质量提升，增加“<a href=\"http://country.huanqiu.com/china\" class=\"linkAbout\" target=\"_blank\">中国</a>制造”有效供给满足消费升级需求。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	会议指出，以先进标准引领消费品质量提升，倒逼装备制造业升级，是实施“中国制造2025”、推动“中国制造”迈向中高端、夯实工业发展根基的关键所在，也是推进供给侧结构性改革的重要抓手，可以依托我国市场巨大的优势，发挥扩大有效需求、提高人民生活品质等多重效应。会议确定，要围绕需求旺盛、与群众生活息息相关的食品、家用电器、装饰装修、化妆品和日用化学品、妇幼老年及残疾人用品等一般消费品领域，发挥市场机制和企业主体作用，建立政府主导制定与市场自主制定协调配套的标准体系。一是紧扣消费品质量安全，制定一批强制性国家标准。提高消费品国内国际标准一致性程度，推动实现内外销产品“同线同标同质”。建立企业标准领跑者制度，支持团体、企业发展优于国家和行业的标准。二是引导企业增强质量、品牌和营销意识，弘扬企业家精神和工匠精神，提高产品全生命周期质量追溯能力，鼓励企业实施首席质量官制度。强化职业教育和培训，建立学校和企业“双元”技术人才培养机制，推出体现技工价值的薪酬、荣誉等制度。强化品牌建设，提高中国消费品知名度和美誉度。鼓励社会资本设立消费品标准和质量提升专项基金。三是创新标准和质量监管，实行随机抽查企业、随机抽检产品、随机选择检测机构，建设消费品质量信息公共服务平台。将企业标准实施情况纳入质量信用记录。检验认证机构对产品质量承担连带责任。四是建立消费品质量安全追溯体系，强化消费维权保护，推进缺陷产品召回常态化，建立消费品质量安全惩罚性赔偿、销售者先行赔付、责任保险等制度。打击侵权假冒等行为。五是把消费品标准与质量提升和装备制造升级紧密结合，以消费市场向中高端发展引导带动装备制造企业提高设备产品的性能、功能和工艺水平，促进 “中国制造”全产业链升级。\r\n</p>', '0', '0', '0', '', '0', '1472349215', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('49', '91', '1', '管理员', '快讯：徐玉玉案最后嫌犯自首 6人悉数落网(图)', '<span style=\"color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;\">【央视快讯：徐玉玉案最后一嫌疑人自首6名嫌疑人全部落网！】央视记者从福建警方获悉，8.19山东临沂徐玉玉案件中，A级通缉令最后一名嫌疑人郑贤聪投案自首，全部涉案嫌疑人悉数到案。（央视记者黄珊）</span><span class=\"ifengLogo\" style=\"color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;\"><a href=\"http://www.ifeng.com/\" target=\"_blank\"><img src=\"http://p2.ifengimg.com/a/2016/0810/204c433878d5cf9size1_w16_h16.png\" style=\"height:auto;\" /></a></span>', '2', '0', '0', '', '0', '1472349271', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('50', '92', '1', '管理员', '全国留守儿童摸底：部分省份上万儿童无人监护', '<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	今年3月，民政部、教育部、公安部联合发文，要求从2016年3月底至7月底，在全国范围内开展一次农村留守儿童摸底排查工作。新京报记者昨日从有关部门了解到，目前这项排查工作已经结束，全国数据将在汇总后于近期发布。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	截至昨日记者发稿，浙江、重庆、山东、四川等省份或辖区内地市已公布摸底排查结果。至少有24个省份出台了具体的留守儿童关爱保护措施，有省份明确要求16岁以下儿童不得独居。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	湖北无人监护留守儿童超1.1万人\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	这次排查的对象是父母双方外出务工或一方外出务工另一方无监护能力，无法与父母正常共同生活的不满十六周岁农村户籍未成年人。根据国家要求，16周岁的计算截止时间为今年7月31日。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	8月23日，福建和江苏两省公布排查结果，福建全省排查出农村留守儿童105176名，江苏排查出的留守儿童达24.2万人。本月陆续公布排查结果的省份还有内蒙古、广东、湖北、青海等省份。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	此次各省公布的数据还包含了留守儿童的健康情况、监护情况、入园入学等受教育情况。如青海省公布的数据显示，该省留守儿童18180人，其中在校生和在幼儿园的为15168人。在福建的10万余留守儿童里，排查出的残疾或患病儿童达到1139名。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	此外，有省份还公布了这些留守儿童中完全处于无人监护状态的儿童数量。如湖北省数据显示，该省现有农村留守儿童73.9万余人，其中无人监护的有1.1万余人；福建也有811名儿童处于无人监护状态。\r\n</p>', '5', '0', '0', '', '0', '1472349332', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('51', '90', '1', '管理员', '中央巡视\"回头看\"4省30官员被点名 都是谁', '<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	（原标题：中央巡视组“回头看”4省30名官员被点名，他们都是谁？）\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	8月26日下午，中央纪委监察部网站继续公布十八届中央第九轮巡视地区和单位的巡视整改情况。截至目前，本次 “回头看”的湖南、安徽、辽宁、山东四省均晒出了“回头看”整改报告。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	根据中央纪委网站执纪审查栏目发布的信息，观海解局统计发现，自今年2月起至8月27日，中央巡视组首次“回头看”的4个省份的30名领导干部，曾被中纪委点名通报，其中多人因涉嫌严重违纪被双开。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<strong>这30个被通报的干部是谁？</strong>\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	根据中央统一部署，2016年2月底至4月底，十八届中央第九轮巡视对包括国务院国资委、海关总署、工商总局、质检总局等在内的32家单位党组织开展专项巡视，同时对辽宁、安徽、山东、湖南等4个省进行“回头看”。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	8月26日，“回头看”3个省湖南、安徽、山东以及相关单位公布了中央第九轮巡视整改情况。此前，在4个“回头看”省份中，辽宁则于前日率先公布巡视整改情况。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	根据中央纪委网站执纪审查栏目发布的信息，观海解局统计发现，自今年2月起至8月27日，中央巡视组首次“回头看”的4个省份，中纪委在官方网站执纪审查栏目共通报30名领导干部。\r\n</p>', '0', '0', '0', '', '0', '1472349364', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('52', '90', '1', '管理员', '广东系列诈骗案:性感女荷官喊你赌博 上千人卷入', '<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	广东省从“飓风1号”到“飓风10号”的“飓风”系列专案收网行动，有效遏制了涉“两抢一盗”、涉毒、涉电信网络诈骗、涉金融领域等4类突出违法犯罪行为。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	18个省97个抓捕小组\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	“飓风”系列全力打击跨国电信诈骗犯罪\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	2016年3月1日，广东省副省长、公安厅厅长李春生一声令下，广东、吉林、山东等18个省市的1000多名警力、97个抓捕小组立即展开了今年广东打击电信网络犯罪1号专案抓捕行动。与此同时，柬埔寨警方对位于柬埔寨波贝的5个电信网络诈骗窝点展开收网行动。\r\n</p>', '1', '0', '0', '', '0', '1472349382', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('53', '92', '1', '管理员', '施暴男被禁接触妻子 如有违反可追究刑责', '<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	京华时报讯 李女士自称遭受丈夫赵某7年家暴，向法院提出离婚并申请人身安全保护令。昨天记者获悉，密云法院开出首张人身安全保护令，禁止赵某再接触妻子，并令其搬出妻子住所。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	现年31岁的李女士诉称，自2009年结婚起，丈夫赵某多次对其进行施暴，并辱骂和威胁她的亲属，致使其身心受到伤害。今年5月28日，丈夫再次对她进行殴打，并造成其轻微伤。7月14日，密云公安分局对赵某作出行政拘留5日并处罚款200元的行政处罚。李女士不堪常年家暴，遂到法院起诉离婚并申请人身安全保护令。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	法院审查后认定李女士的申请符合发出人身安全保护令的条件，随即开出人身安全保护令，禁止赵某对其实施家庭暴力及骚扰、跟踪、接触等行为，并搬出李女士的住所，如有违反，轻则拘留罚款，重则受到刑事制裁。法院还将人身安全保护令向李女士、赵某当地居委会及公安机关进行送达。当地公安机关及村委会表示，将依法积极协助人身安全保护令的执行。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	赵某表示没有异议，并保证能够做到不再打骂骚扰妻子。目前，两人离婚一案还在审理中。\r\n</p>', '3', '1', '0', '', '0', '1472349408', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('54', '92', '1', '管理员', '中国花甲夫妻游美国：自带电饭锅 自驾近5000英里', '<p style=\"font-family:\'Microsoft YaHei\', 微软雅黑, SimSun, 宋体;font-size:16px;text-indent:30px;background-color:#FFFFFF;\">\r\n	美媒称，在中国，收入的增加使旅游市场变得异常火热，与之相伴的是关于中国游客在海外表现不好的说法。在1亿多出国旅游的中国人中，绝大多数都不是这样的。当然，也有享有特权的富豪，但更多的是疲惫的上班族和抓住机会尝试新事物、善意的首次出国者。\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', 微软雅黑, SimSun, 宋体;font-size:16px;text-indent:30px;background-color:#FFFFFF;\">\r\n	美国《华盛顿邮报》网站8月17日报道，他们的美国大冒险开始得很仓促。6月，64岁的陈爱武和她66岁的老伴汪东升(音)乘机抵达洛杉矶，当时已近午夜，而他们几乎无法与人沟通。他们面临着一个典型的度假难题：租车行的推销行为。陈爱武回忆道：“我只是不停地说我会的惟一英文单词‘不’。”\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', 微软雅黑, SimSun, 宋体;font-size:16px;text-indent:30px;background-color:#FFFFFF;\">\r\n	报道称，4个多小时后，在一位路过华人的帮助下，这对中国退休夫妇开始了长达19天、行程4850英里的美国自驾游。这段从滨海的加州到拉斯维加斯、约塞米蒂和黄石公园的来回旅程，不仅考验了他们的耐心，而且使他们了解了一个一度令他们感觉无限遥远的民族和国家。他们对美国的基础设施深感失望，对美国的家庭充满好奇，而且一再被他们遇到的好心人感动。\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', 微软雅黑, SimSun, 宋体;font-size:16px;text-indent:30px;background-color:#FFFFFF;\">\r\n	在他们回国时，官方媒体不仅对他们的美国之行作了介绍，还在网上对他们大加赞赏。《中国日报》的大字标题是“这对夫妇证明了年龄不是环球旅行的障碍。”\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', 微软雅黑, SimSun, 宋体;font-size:16px;text-indent:30px;background-color:#FFFFFF;\">\r\n	中国社交媒体网站新浪微博的一位用户说：“一对了不起的夫妇！我希望我老了以后也可以像他们一样。”\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', 微软雅黑, SimSun, 宋体;font-size:16px;text-indent:30px;background-color:#FFFFFF;\">\r\n	报道称，在将孩子养大成人、努力工作并有\r\n</p>', '9', '2', '0', '', '0', '1472349447', '0', '0', '0');
INSERT INTO `smeoa_forum` VALUES ('55', '76', '1', '管理员', '上海假结婚乱象调查1张结婚证5万黄牛1年赚千万', '<p style=\"color:#3A3A3A;font-size:14px;text-indent:2em;font-family:微软雅黑, \'Microsoft YaHei\';\">\r\n	的购房资格。近期，记者在走访楼市时，了解到上海有一个隐秘的灰色市场，帮人骗取购房资格，那就是“假结婚”。<span style=\"line-height:1.6;\">所谓“假结婚”，就是购房者通过中介找人办理真实的结婚证件，从而能够具备购房资格，同时需要支付给中介以及假结婚对象一定的报酬。房屋交易流程结束后，双方再离婚。记者通过数周的暗访调查，走进了隐蔽在现实和网络上的假结婚圈子。</span>\r\n</p>\r\n<p style=\"color:#3A3A3A;font-size:14px;text-indent:2em;font-family:微软雅黑, \'Microsoft YaHei\';\">\r\n	“说白了，我们就是卖人。别的你不用管，年龄啊，职业啊，能跟你领结婚证就可以了，又不会和你真的住在一起。”在中介口中，假结婚业务纯粹就是“卖人”的生意，而且每个人的使用额度没有上限。记者调查发现，假结婚业务的收费惊人，具体价格与假结婚对象的年龄、性别挂钩。如果男性寻找女性假结婚，一般需要五万元，但年龄一般在四五十岁左右。如果需要更年轻的，价格则需要十万元。<span style=\"line-height:1.6;\">“先签婚前财产协议，然后领结婚证、购房、更名、离婚。一切都没问题，就是钻政策法律的空子，这都是合法的，你都不用担心。”在假结婚中介这里，这一连串的流程看起来完美无缺。但是在法学专家沈亮看来，假结婚在形式上虽然并不违法，但实质上是欺骗了法律，钻政策的空子。</span><span style=\"line-height:1.6;\">然而，随着记者的深入调查，一些组织已经将假结婚，打造成一个“产业链”。</span>\r\n</p>', '3', '0', '0', '', '0', '1472349530', '0', '0', '0');
