INSERT INTO `smeoa_forum_post` VALUES ('144', '0', '38', '', '<p class=\"p\" style=\"margin-left:0cm;\">\r\n	<p class=\"p\" style=\"margin-left:0cm;\">\r\n		Data Models are\r\ndefined in the<span class=\"apple-converted-space\">&nbsp;</span>&lt;extension&gt;-items.xml<span class=\"apple-converted-space\">&nbsp;</span>file of each extension. Essentially data entities (called\r\n\"items\" in<span class=\"apple-converted-space\">&nbsp;</span><span class=\"ph\">Hybris</span>) are defined with itemtype elements, whereas relations\r\nbetween items are defined with relation elements. For example, open<span class=\"apple-converted-space\">&nbsp;</span>cuppy/resources/cuppy-items.xml<span class=\"apple-converted-space\">&nbsp;</span>and have a closer look at the numerous relation and itemtype\r\ndefinitions which refer to the Cuppy Data Model.\r\n	</p>\r\n	<p class=\"p\" style=\"margin-left:0cm;\">\r\n		The<span class=\"apple-converted-space\">&nbsp;</span><span class=\"ph\">SAP Hybris Commerce</span><span class=\"apple-converted-space\">&nbsp;</span>build system extracts the<span class=\"apple-converted-space\">&nbsp;</span>\\*-items.xml<span class=\"apple-converted-space\">&nbsp;</span>files located in all extensions and generates for every itemtype\r\na number of Java Source files to support access to these entities from within\r\nthe<span class=\"apple-converted-space\">&nbsp;</span><span class=\"ph\">SAP Hybris\r\nCommerce</span><span class=\"apple-converted-space\">&nbsp;</span>framework (most\r\nnotably via Java calls in the ServiceLayer as well as via RESTful URIs). The\r\nred classes in the diagram below show the files created for the<span class=\"apple-converted-space\">&nbsp;</span><strong>Player</strong><span class=\"apple-converted-space\">&nbsp;</span>itemtype in<span class=\"apple-converted-space\">&nbsp;</span>cuppy-items.xml. The classes from which they are derived are shown in yellow.\r\n	</p>\r\n	<p class=\"p\" style=\"margin-left:0cm;\">\r\n		<span></span>\r\n	</p>\r\n	<ul>\r\n		<li class=\"MsoNormal\" style=\"color:#333333;text-align:left;\">\r\n			Model classes created\r\n     for use in the ServiceLayer where partners are encouraged to develop their\r\n     business logic. Below, we will specify a new Itemtype<span class=\"apple-converted-space\">&nbsp;</span><strong>Stadium</strong>, and<span class=\"apple-converted-space\">&nbsp;</span><span class=\"ph\">Hybris</span><span class=\"apple-converted-space\">&nbsp;</span>will generate several files\r\n     including a StadiumModel Java class that we can use.\r\n		</li>\r\n		<li class=\"MsoNormal\" style=\"color:#333333;text-align:left;\">\r\n			Webservice-related\r\n     classes which are created to support CRUD logic via RESTful URIs.<span class=\"apple-converted-space\">&nbsp;</span><strong>These classes are only generated when the\r\n     optional extension platformwebservices is included in your configuration.</strong>We\r\n     will see how the Java classes StadiumDTO(s) and StadiumResoure(s) are used\r\n     in the webservice trail step.\r\n		</li>\r\n		<li class=\"MsoNormal\" style=\"color:#333333;text-align:left;\">\r\n			Low-level Jalo\r\n     classes. We will not address these classes as their use is discouraged.\r\n		</li>\r\n	</ul>\r\n	<p class=\"p\" style=\"margin-left:0cm;\">\r\n		As depicted in the\r\nmockup, we would like to represent a new entity - Stadium - and for each\r\nStadium a list of its matches. Matches are already defined in the<span class=\"apple-converted-space\">&nbsp;</span><strong>Cuppy</strong><span class=\"apple-converted-space\">&nbsp;</span>extension. Therefore, our main tasks\r\nare to:\r\n	</p>\r\n</p>', '181', '王莉', '', '0', '1471403666', '1471403699');
