INSERT INTO `smeoa_mail` VALUES ('42', '1', '<tencent_443713AE44478CDE330E1750@qq.com>', '关于公司总部邮箱签名', '<div><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><br></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:115%\"><span style=\"font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:115%;font-family:宋体;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\r\nminor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">各位同事：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;line-height:115%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;font-family:\r\n宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\n宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin\">由于出现各邮件客户端收取邮件时，会无法查阅到企业邮箱网页版发送的签名档图片。所以，网页版邮件签名档上传签名档时，请依照以下步骤设置：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;line-height:115%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;font-family:\r\n宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\n宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin\">（</span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;line-height:115%\">1</span><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;font-family:\r\n宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\n宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin\">）将↓图片另存为图片，见附件</span><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><img src=\"/Data/Files/mail/admin/201607/578f491a260e8.8EF28E57\"></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-indent:18.0pt;mso-char-indent-count:1.5\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:宋体;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\r\nminor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">（</span><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt\">2</span><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:宋体;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\r\nminor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）在设置中的个性签名档添加时，选择图片插入。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-indent:18.0pt;mso-char-indent-count:1.5\"><!--[if gte vml 1]><v:shapetype id=\"_x0000_t13\" coordsize=\"21600,21600\" o:spt=\"13\" adj=\"16200,5400\" path=\"m@0,l@0@1,0@1,0@2@0@2@0,21600,21600,10800xe\">\r\n <v:stroke joinstyle=\"miter\"></v:stroke>\r\n <v:formulas>\r\n  <v:f eqn=\"val #0\"></v:f>\r\n  <v:f eqn=\"val #1\"></v:f>\r\n  <v:f eqn=\"sum height 0 #1\"></v:f>\r\n  <v:f eqn=\"sum 10800 0 #1\"></v:f>\r\n  <v:f eqn=\"sum width 0 #0\"></v:f>\r\n  <v:f eqn=\"prod @4 @3 10800\"></v:f>\r\n  <v:f eqn=\"sum width 0 @5\"></v:f>\r\n </v:formulas>\r\n <v:path o:connecttype=\"custom\" o:connectlocs=\"@0,0;0,10800;@0,21600;21600,10800\" o:connectangles=\"270,180,90,0\" textboxrect=\"0,@1,@6,@2\"></v:path>\r\n <v:handles>\r\n  <v:h position=\"#0,#1\" xrange=\"0,21600\" yrange=\"0,10800\"></v:h>\r\n </v:handles>\r\n</v:shapetype><v:shape id=\"_x0000_s1026\" type=\"#_x0000_t13\" 