INSERT INTO `smeoa_notice` VALUES ('3', '2016-0003', '企业概况', '<span style=\"color:#555555;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:24px;background-color:#F5F5F5;\"><span style=\"color:#555555;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:24px;background-color:#F5F5F5;\">企业概况</span><span style=\"color:#555555;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:24px;background-color:#F5F5F5;\">企业概况</span><span style=\"color:#555555;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:24px;background-color:#F5F5F5;\">企业概况</span><span style=\"color:#555555;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:24px;background-color:#F5F5F5;\">企业概况</span><span style=\"color:#555555;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:24px;background-color:#F5F5F5;\">企业概况</span></span><span style=\"color:#555555;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:24px;background-color:#F5F5F5;\"></span>', '68', '', '1', '管理员', '1461842367', '0', '1', '1', '1', '27;', '0', '0', null, null, null);
INSERT INTO `smeoa_notice` VALUES ('4', '2016-0004', '企业介绍', '<p style=\"margin-left:0in;\">\r\n	浙江神洲酷奇科技发展有限公司，注册成立于2011年1月份, 开始在电商运营、电商服务领域进行摸索和建设。2014年，公司旗下的电商服务项目—神洲创业成立，定位为中国最大的电商服务集成商，专业致力于为中小微电商创业群体提供一站式的服务解决方案。\r\n</p>\r\n<p style=\"margin-left:0in;\">\r\n	<br />\r\n</p>\r\n<p style=\"margin-left:0in;\">\r\n	得益于神洲酷奇九年多的电商行业积累，神洲创业已完成对中国电商创业集群、运营服务集合、互联创新集成等多种资源的整合，提供从办公场景到运营场景的整体电商配套服务，包括基于大数据应用的仓储物流、商业办公、运营支持、产品渠道以及金融服务等，真正助力创业群体在电商市场上获得核心竞争力。\r\n</p>\r\n<p style=\"margin-left:0in;\">\r\n	<br />\r\n</p>\r\n<p style=\"margin-left:0in;\">\r\n	随着杭州、金华、宁波、嘉兴等园区的陆续投入运营，神洲创业将迈进依托长三角布局全国的快速发展黄金通道，成为国内电子商务服务领域的领跑者。自成立以来，神洲创业已入选浙江电子商务模式创新10强企业、中国跨境电子商务首批试点企业、\r\n“浙江省电子商务促进会”副会长单位以及“浙江省商贸业联合会”常务理事单位等荣誉。\r\n</p>', '68', '', '1', '管理员', '1461893239', '0', '1', '1', '1', '27;', '0', '0', null, null, null);
