INSERT INTO `smeoa_notice` VALUES ('47', '2016-0047', '青年节：岁月不老，青春不朽', '<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	五四青年节，源于中国1919年反帝爱国的“五四运动”。1939年，陕甘宁边区西北青年救国联合会规定5月4日为中国青年节。\r\n</p>\r\n<p align=\"center\" style=\"margin-left:0cm;text-align:center;text-indent:24.0pt;\">\r\n	<br />\r\n<!--[endif]-->\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	青年节期间，中国各地都要举行丰富多彩的纪念活动，青年们还要集中进行各种社会志愿和社会实践活动，还有许多地方在青年节期间举行成人仪式。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	节日起源\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	五四运动是1919年5月4日发生在北京以青年学生为主的一场学生运动，广大群众、市民、工商人士等中下阶层广泛参与的一次示威游行、请愿、罢工、暴力对抗政府等多形式的爱国运动。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	从1918年11月的“公理战胜强权”庆典，到次年1月的巴黎会议，短短两个月时间，当时的中国充分诠释了“自古弱国无外交”的定律，所谓的“公理战胜强权”不过是一个美丽的童话。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	面对这样屈辱的局面，从5月1日开始，北京的学生纷纷罢课，组织演讲、宣传，随后天津、上海、广州，南京，杭州，武汉，济南的学生、工人也给予支持。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	五四运动，其主力是学生和青年，他们的爱国精神、为真理和正义而战的精神、不畏强暴和黑暗政治精神值得任何时代的青年和学生学习。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	五四精神\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	五四精神的核心内容为“爱国、进步、民主、科学”。五四精神代表着诚实的，进步的，积极的，自由的，平等的，创造的，美的，善的，和平的，相爱互助的，劳动而愉快的，全社会幸福的统一体现。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	节日庆祝\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	1939年，在纪念五四运动20周年的时候，陕甘宁边区西北青年救国联合会决定5月4日为中国青年节（又称“五四青年节”）。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	1949年，中华人民共和国政务院正式宣布5月4日为中国青年节，但并非全民假日，仅14至28周岁的青年可放假半天。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	在香港、澳门主权回归后，五四青年节虽没有成为法定公众假期，但亦在港澳两地逐渐举办了些纪念性活动，如金紫荆广场五四升旗礼。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	在台湾，青年节则于1954年时改订为“三二九青年节”，以纪念1911年广州黄花岗起义殉难的青年烈士。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	少年中国说\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	梁启超的《少年中国说》是青春中国诞生的第一口呼吸。时隔一个多世纪，重温这些文字，仍使人心潮澎湃、热血沸腾。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	故今日之责任，不在他人，而全在我少年。少年智则国智，少年富则国富；少年强则国强，少年独立则国独立；少年自由则国自由；少年进步则国进步；少年胜于欧洲，则国胜于欧洲；少年雄于地球，则国雄于地球。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	美哉我少年中国，与天不老！\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	壮哉我中国少年，与国无疆！\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	一百多年前的中国少年化身为血肉之躯、革命的先锋、未来历史的塑造者，用一腔热血奉献给了自己无悔的青春。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	到如今，一批又一批的青年成为民族的希望与脊梁，肩负起了保卫和建设祖国的重任。他们发愤图强，以只争朝夕的精神为理想而奋斗。\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	青春不是人生的一段时期，而是心灵的一种状态。每一段青春都是限量版，你找到自己独特的使命了吗？\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	青春是我们一直为之努力的理想，青春是生命最深处不屈的意志，青春是百折不挠的积极心态 岁月不老，青春不朽！\r\n</p>\r\n<p style=\"margin-left:0cm;text-indent:24.0pt;\">\r\n	青春加油！现在过的每一天，都是余生中最年轻的一天。从今天起，跟青春来个约定，做一个平凡温暖、独一无二的自己。\r\n</p>', '74', '', '1', '管理员', '1462780384', '0', '0', '1', '1', '27;', '0', '0', null, null, null);
INSERT INTO `smeoa_notice` VALUES ('48', '2016-0048', '最高的情商，就是满怀感恩去工作', '<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	在儿子踏入社会前，有位父亲告诫儿子三句话：“<strong>遇到一位好领导，要忠心为他工作；假如第一份工作就有很好的薪水，那算你的运气好，要努力工作以感恩惜福；万一薪水不理想，就要懂得在工作中磨炼自己的技艺。</strong>&nbsp;”\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	这位父亲无疑是睿智的。所有的年轻人都应将这三句话深深地记在心里，始终秉行这个原则做事。\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	或许每一份工作都无法尽善尽美，但还是要感谢工作环境，感谢老板，感谢每一次的工作机会，满怀感恩之心去工作。即使起初位居他人之下，也不要去计较，要积极地将每一次工作任务视为一个新的开始，一段新的体验，一扇通往成功的机会之门。\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	因为每一份工作都有宝贵的经验和资源，如失败的沮丧、成功的喜悦、老板的严苛、同事间的竞争等，这些都是任何一个工作者走向成功必须体验的感受和必须经历的锻造。\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	目前一些处在实习期的大学毕业生，还没干活就先和老板谈条件，或者在新岗位上刚取得一点小成绩，就和部门主管讨价还价，这是不合时宜的。他们应该懂得感谢企业的培养，而不是计较是否应多拿几百元钱，应该在自己有业绩的时候，再向企业提出合理的加薪要求，这样在企业里才能有更大的发展。\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	程序员史蒂文斯在一家软件公司干了八年，正当他干得得心应手时，公司倒闭了。这时，又恰逢他的第三个儿子刚刚降生，他必须马上找到新工作。\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	有一家软件公司招聘程序员，待遇很不错，史蒂文斯信心十足地去应聘了。凭着过硬的专业知识，他轻松地过了笔试关。两天后就要参加面试，他对此充满了信心。\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	可是面试时，考官提的问题是关于软件未来发展方向的，他从来没考虑过这方面的问题，他被淘汰了。\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	不过这家公司对软件产业的理解让他耳目一新。他给公司写了一封感谢信：“贵公司花费人力物力，为我提供笔试、面试的机会，我虽然落败了，但长了很多见识。感谢你们的劳动，谢谢!”这封信经过层层传阅，后来被送到总裁手中。\r\n</p>\r\n<p style=\"margin-left:0cm;text-align:justify;text-indent:24.0pt;background:#F7FCFF;\">\r\n	三个月后，史蒂文斯却意外地收到了该公司的录用通知书。原来，这家公司看到了他知道感恩的品德，在有职位空缺的时候自然就想到了他，这家公司就是美国微软公司。十几年后，史蒂文斯凭着出色的业绩成了微软的副总裁。\r\n</p>', '74', '', '1', '管理员', '1462780430', '0', '0', '1', '1', '27;', '0', '0', null, null, null);
INSERT INTO `smeoa_notice` VALUES ('49', '2016-0049', '与其尝尝抱怨 不如开始改变', '<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	一个“职场抱怨状态”调查报告显示：在参与调查的五千余人中，65.7%的人表示自己一天抱怨次数在1-5次之问，13.8%的入每天抱怨6-10次，3.7%的人每天抱怨11-15次，还有4.8%的职场人表示，自己每天抱怨次数甚至高达20次以上，只有11.2%的人表示从不抱怨或没有意识到自己是否抱怨。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	抱怨是工作不能有效落实的主要心理障碍，当一个人在抱怨的时候，或者处在抱怨的情绪当中时，他的能量在减少，信心在降低，身心都处在一个无力的状态。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	一些人将抱怨变成了一种习惯，如同生活中很多人把“烦死了”“好烦”“郁闷”等词句变成口头禅一样，而很少有人意识到自己爱抱怨，觉察到自己的抱怨频率有多高。抱怨就像口臭，我们可以轻易地发现别人在抱怨，却对自己口中发出的抱怨充耳不闻。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	具体来说，抱怨对于工作落实和职业进步有以下害处：\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	<b>一、抱怨让人自暴自弃</b>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	抱怨是最消极的心理自我暗示，不停地暗示自己的不成功都是他人的错，暗示世界对自己不公平，让自己有理由不努力。当你抱怨的时候，你在表现自己的弱势和无能为力，希望得到别人的怜悯、同情和照顾，你越抱怨，自己的内心越感到虚弱。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	抱怨总是让人觉得失败，想要放弃，而这失败往往不是别人给的，而是自找的。有的人总是羡慕、嫉妒那些闪闪发光的人，却不曾看到他们的付出。在无聊地用肥皂剧打发时间时，慵懒地翻着杂志时，这些闪闪发光的人刚刚熬完一个通宵，刚刚喝掉一杯用来提神的咖啡并开始新的工作。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	如果说抱怨之后，不满与郁闷能够随风而去，心境能够变得开朗明亮起来，那抱怨还算是有价值的。可问题在于，抱怨恰如一股阴冷潮湿的黑雾，足以遮蔽人的双眼、迷惑人的心智、阻碍人的成长，最终让人在怨天尤人的泥潭里越陷越深。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	现年35岁的晓婷如今做到了外银高阶主管。她刚进公司时，因为个性好、不说“No”，成为工作量最大的一位。正是因为“不计较、不抱怨”，她得到的学习机会比别人多，更使她累积了许多新兴金融商品的知识，自然她的晋升也比别人快。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	晓婷说，“计较和抱怨也许能争来眼前的公平，但未来却失去更多机会。”她特别提醒一些喜欢抱怨的人，如果仍处在“五不上”时期，最好把爱抱怨的嘴给堵上。所谓的“五不上”就是“专业谈不上、经验谈不上、升职谈不上、加薪谈不上、奖励谈不上”。晓婷认为，一个人只能通过改变自己来改变环境，影响他人，成就自己。抱怨只能让自己越来越弱，以至于一事无成。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	对于员工来说，养成事事抱怨的习惯无异于让自己陷入失败的怪圈：抱怨——消极心态——工作陷入被动——得不到公司认可——越发抱怨——更加不满的心态——工作效率降低——受到公司处罚、警告或者辞退。所以说，从某种意义上讲，抵制抱怨也就是避免自己陷入失败的怪圈。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	抱怨的实质是为自己目前不良的状况寻找理由，归根结底是一种懒惰的表现。抱怨让人推脱属于自己的责任，寻找借口，放弃自我反省、自我扬弃、自我提高与改善的机会。“让他人去承担这个责任吧，这样我心里也会觉得好受一点，我没有能力改变了……”抱怨就像烟雾弹，干扰视线、混淆视听，从而顺理成章地把事情的责任推脱掉，避开整个事件的本质，原谅自己，放纵自己。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	由于不做改变，安于现状，自己永远也无法强大起来。当一个人过多地被消极语言困扰的时候，会失去行动力，开始形成负面思维，一遇到事情就会消极思考。一个每天抱怨薪水微薄的人，永远没有可能加薪，因为他把精力都集中在薪水上，而没有考虑如何把工作做得更好;一个每天都抱怨公司环境的人，永远不可能把工作落实到位，因为工作落实需要全身心投入，积极工作的人没有时间去抱怨。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	通常说来，一个人做得越多，抱怨越少;相反，一个人做得越少，他的抱怨也会越多。如果说抱怨也能造就一个人的话，那就是男人成为“愤青”，女人成为“怨妇”。也就是说，因为这些抱怨，他们已经逐渐远离了优质的生活，远离了让自己走向优秀的道路。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	<b>二、抱怨破坏人际关系</b>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	一个人在抱怨时，除了不断地给自己增加某种负面的心理暗示外，还会影响到周围人对自己的判断和看法，从而使他人对自己的印象产生负面影响。从量的角度上看，抱怨所获得的快感和情绪宣泄只是一个人的，但抱怨所造成的负面影响却会影响一群人。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	经常抱怨的人最后可能被周围的人们所抛弃，因为他们发现自己的能量被这个抱怨者榨干了。最后，抱怨者越来越让人反感和不可接受，人际交往面越来越窄，他们最终将在抱怨中度过自己哀怨的一生，成为人见人怕的“祥林嫂”式的悲剧人物。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	抱怨相当于赤脚在石子路上行走，而乐观是一双结结实实的鞋。抱怨丧失的不仅是勇气，还会失去朋友。谁都恐惧牢骚满腹的人，怕自己也受到传染。失去了勇气和朋友，人生会变得很难。所以抱怨的人继续抱怨，他们不知道，人生有许多简单的技艺可以化险为夷，闭嘴是其中的妙谛之一。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	小苗刚参加工作，深感写字楼里的人情冷漠，好在同办公室的娟子大姐非常热情，总是爱和她拉家常，这让她的心里一阵暖意。很多心里话也愿意和娟子说。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	时间一长，家常就成了诉苦，小到孩子太闹太烦人，大到公司领导的用人不公。刚开始的一两次小苗还会认真听，会告诉她自己的建议。到后来，小苗给娟子的就只是“这样做没有用”之类的否定答案。再后来，久而久之，小苗发现其实娟子要的并不是一个真诚的建议，而是一个不会发言的听众。于是也就听听算了，并不会把她的话当一回事。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	等和公司的人都熟悉了，小苗才听其他同事讲，娟子的绰号就叫“婆婆嘴”，整个就是一怨妇。公司很多闲话都是从她那里传出去的。从那以后，小苗面对娟子时，能躲就躲，躲不了就敷衍。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	<b>三、抱怨改变不了现实</b>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	抱怨有什么用呢?不会因为一个人的抱怨，一个差单位就会变成一个好单位;不会因为一个员工的抱怨，讨厌的领导就换成了喜欢的领导。客观的总是客观的，不会以人的主观意志为转移。喜欢抱怨的人应该思考：为什么老是跟自己过不去呢?为什么不想想怎么样在既定条件下发挥主观能动性呢?无论抱怨的人如何抱怨不止：“你怎么还不快走?”“你怎么还在这?”现实依然不会改变。我们唯一能做的是改变自己的态度。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	有一个农夫正在划着小船过河。突然间，农夫发现，有一只小船迎面向自己快速驶来。眼看两只船就要撞上了，但那只船并没有丝毫避让的意思。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	“让开，快点让开!你这个混蛋!”农夫大声地向对面的船吼叫道：“再不让开你就要撞上我了!”但农夫的吼叫完全没用，说时迟那时快，那只船重重地撞上了他的船。农夫被激怒了，他竭斯底里地怒斥道：“你会不会驾船，这么宽的河面，你竟然撞到了我的船上!”当农夫怒目审视这条小船时，他吃惊地发现，小船上空无一人。听他大呼小叫、厉声斥骂的只是一只挣脱了绳索、顺河漂流的空船。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	在多数情况下，当你抱怨、责难、怒吼的时候，你的听众或许是一艘“空船”。那个一再惹怒你的人，绝不会因为你的斥责而改变方向。古人云：人生处处多忧愁，抱怨不如多奋斗。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;background:#F7FCFF;\">\r\n	生活中，人们都在做不同的事，和不同的人打交道，沿着人生不一样的轨道前行。那些繁琐的、烦人的、惆怅的、难过的、不如意的，应该有一箩筐，与其在不如意时一味地抱怨，不如尝试着去改变，改变自己、改变现状，让生活和工作变得如意起来。\r\n</p>', '74', '', '1', '管理员', '1462780468', '0', '0', '1', '1', '27;', '0', '0', null, null, null);
