INSERT INTO `smeoa_notice` VALUES ('152', '2016-0152', '公司的今日新闻', '<span style=\"color:#333333;font-family:Arial, 宋体;font-size:10.5pt;background-color:#F2F2F2;\">神洲创业为浙江神洲酷奇科技发展有限公司旗下的一个全新商业模式，基于九年间神洲酷奇对互联网及电子商务的行业知识、市场需求、线上渠道、上游供应、营销能力等多种资源的整合，致力于为中小微电商企业及个体，提供规范化的标准服务，聚合电商从业者，构建完善产业生态链，打造集创业孵化、统筹管理、资源整合等服务为一体的电子商务运营服务创新模式。</span><span style=\"color:#333333;font-family:Arial, 宋体;font-size:10.5pt;background-color:#F2F2F2;\"><br />\r\n</span><span style=\"color:#333333;font-family:Arial, 宋体;font-size:10.5pt;background-color:#F2F2F2;\"> 公司的总部位于美丽的西子湖畔杭州，服务创业的园区分布在北京，杭州，宁波，金华，嘉兴等地。为了更好的服务于创业者，更多园区正在快速筹建中。</span>', '95', '814db5ae38a58413c9d35a865ffdcd6e;', '1', '管理员', '1472007280', '0', '1', '1', '1', '27;', '2', '10', '', null, null);
