INSERT INTO `smeoa_notice` VALUES ('163', '2016-0163', '第一个头条', '<span style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:19.5px;color:#3E3E3E;background-color:#F1EFEF;\">神洲创业为浙江神洲酷奇科技发展有限公司旗下的一个全新商业模式，基于九年间神洲酷奇对互联网及电子商务的行业知识、市场需求、线上渠道、上游供应、营销能力等多种资源的整合，致力于为中小微电商企业及个体，提供规范化的标准服务，聚合电商从业者，构建完善产业生态链，打造集创业孵化、统筹管理、资源整合等服务为一体的电子商务运营服务创新模式。</span><span style=\"color:#393939;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:19.5px;background-color:#F1EFEF;\"></span>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"color:#3E3E3E;\">公司的总部位于美丽的西子湖畔杭州，服务创业的园区分布在杭州，宁波，金华，嘉兴等地。为了更好的服务于创业者，更多园区正在快速筹建中。</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background-color:#F1EFEF;\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"color:#3E3E3E;\">神洲荣誉</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2011</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">成为浙江省商贸业联合会</span><span style=\"color:#3E3E3E;\">常务理事单位</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2012</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">入选浙江省网络零售促进工程试点单位</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2013</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">入选商务部商贸流通业典型统计企业</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2013</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">成为浙江省电子商务促进会副会长单位</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2014</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">入选浙江省电子商务百强企业，获评</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">“</span><span style=\"color:#3E3E3E;\">浙江省电子商务创新模式十强企业</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">”</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2014</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">总经理谢树济获评</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">“</span><span style=\"color:#3E3E3E;\">浙江省电子商务</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">10</span><span style=\"color:#3E3E3E;\">大领军人物</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">” &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2015</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">再次入选浙江省电子商务百强企业，获评</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">“</span><span style=\"color:#3E3E3E;\">浙江省电子商务创新模式十强企业</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">” &nbsp;</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2015</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">参与起草浙江省电子商务仓储管理与服务规范标准</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2015</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">总经理谢树济当选浙江省专业标准化技术委员会委员</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2015</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">中国（杭州）跨境电子商务综合试验区首批试点企业</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2015</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">被浙江省商贸流联合会评定为</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">“</span><span style=\"color:#3E3E3E;\">诚信示范企业</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">” &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;</span>\r\n</p>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">2015</span><span style=\"color:#3E3E3E;\">年</span><span style=\"color:#3E3E3E;\">总经理谢树济获评</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">“</span><span style=\"color:#3E3E3E;\">温商新星奖</span><span style=\"font-family:Helvetica, sans-serif;color:#3E3E3E;\">”</span>\r\n</p>', '95', '264d48d787d857d0abab4d107eda227a;', '3', '李国勉', '1472088179', '0', '1', '1', '1', '27;', '1', '5', '', null, null);
