INSERT INTO `smeoa_notice` VALUES ('171', '2016-0171', '习近平：尊重自然顺应自然保护自然 坚决筑牢国家生态安全屏障', '<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	新华社西宁8月24日电 中共中央总书记、国家主席、中央军委主席习近平近日在青海考察时强调，生态环境保护和生态文明建设，是我国持续发展最为重要的基础。青海最大的价值在生态、最大的责任在生态、最大的潜力也在生态，必须把生态文明建设放在突出位置来抓，尊重自然、顺应自然、保护自然，筑牢国家生态安全屏障，实现经济效益、社会效益、生态效益相统一。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	八月的青海高原，群山巍巍，风光壮美。8月22日至24日，习近平在青海省委书记王国生、省长郝鹏陪同下，来到海西、海东、西宁等地，就贯彻落实“十三五”规划、加强生态环境保护、做好经济社会发展工作进行调研考察。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	8月22日上午，习近平乘专机抵达海西<a href=\"http://country.huanqiu.com/mongols\" class=\"linkAbout\" target=\"_blank\">蒙古族</a><a href=\"http://country.huanqiu.com/tibetan\" class=\"linkAbout\" target=\"_blank\">藏族</a>自治州格尔木市，下午即驱车前往位于柴达木盆地的察尔汗盐湖考察。这是我国最大的盐湖，也是世界上最著名的内陆盐湖之一。青海利用这里的盐湖资源，早在上世纪50年代就开始发展盐化工业。目前，青海盐湖工业股份有限公司已经形成钾盐、钠盐、镁盐、锂盐、氯碱5个产业群，其金属镁项目是国家首批13个循环经济试验区之一柴达木循环经济试验区的核心项目。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	在盐湖码头，他听取了柴达木循环经济发展情况介绍，了解企业综合利用盐湖资源、推进产业技术升级情况，并察看氯化钾、氢氧化钾、硝酸钾、锂电池、镁合金等盐化工产品展示。随后，他沿栈道步行至盐湖边，察看现代化机械采盐操作，了解盐湖资源储备保护、开发利用等情况。习近平指出，盐湖资源是青海的第一大资源，也是全国的战略性资源，务必处理好资源开发利用和生态环境保护的关系。发展循环经济是提高资源利用效率的必由之路，要牢固树立绿色发展理念，积极推动区内相关产业流程、技术、工艺创新，努力做到低消耗、低排放、高效益，让盐湖这一宝贵资源永续造福人民。\r\n</p>', '95', '', '1', '管理员', '1472095953', '0', '1', '1', '1', '27;', '2', '15', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('172', '2016-0172', '十大世界最富裕国家排名出炉：中国名列第二', '<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	【环球网报道&nbsp;记者&nbsp;任梅子】据<a href=\"http://country.huanqiu.com/russia\" class=\"linkAbout\" target=\"_blank\">俄罗斯</a>卫星网8月24日报道，市场研究公司“新世界财富(New&nbsp;World&nbsp;Wealth)公布的《W10：10个世界最富裕国家》排名中，<a href=\"http://country.huanqiu.com/china\" class=\"linkAbout\" target=\"_blank\">中国</a>名列第二位。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	“新世界财富”在其公布的排名中统计的是各国国民的“总体个人财富”，其中包括房地产、现金、银行存款、事业生意等。\r\n</p>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	中国的“总体个人财富”达到17.4万亿美元，排名第二。报告指出，中国在最近15年里展现出的财富增加速度最快。最富裕的国家是<a href=\"http://country.huanqiu.com/america\" class=\"linkAbout\" target=\"_blank\">美国</a>(48.9万亿美元)，第三名是<a href=\"http://country.huanqiu.com/japan\" class=\"linkAbout\" target=\"_blank\">日本</a>(15.1万亿美元)。\r\n</p>\r\n<div class=\"ad250x250 fLeft marRig10\" id=\"adPp\" style=\"padding:20px 22px 20px 23px;border:1px solid #EBEBEB;margin:0px 30px 5px 0px;color:#2B2B2B;font-family:SimSun;font-size:16px;\">\r\n	<div id=\"ad_survey_ad_slot_9263\" style=\"margin:0px;padding:0px;border:0px;\">\r\n		<a></a>\r\n	</div>\r\n</div>\r\n<p style=\"font-size:16px;font-family:SimSun;color:#2B2B2B;\">\r\n	前十名中还有<a href=\"http://country.huanqiu.com/united_kingdom\" class=\"linkAbout\" target=\"_blank\">英国</a>(9.2万亿美元)、<a href=\"http://country.huanqiu.com/germany\" class=\"linkAbout\" target=\"_blank\">德国</a>(9.1万亿美元)、<a href=\"http://country.huanqiu.com/france\" class=\"linkAbout\" target=\"_blank\">法国</a>(6.6万亿美元)、<a href=\"http://country.huanqiu.com/india\" class=\"linkAbout\" target=\"_blank\">印度</a>(5.6万亿美元)、<a href=\"http://country.huanqiu.com/canada\" class=\"linkAbout\" target=\"_blank\">加拿大</a>(4.7万亿美元)、<a href=\"http://country.huanqiu.com/australia\" class=\"linkAbout\" target=\"_blank\">澳大利亚</a>(4.5万亿美元)、<a href=\"http://country.huanqiu.com/italy\" class=\"linkAbout\" target=\"_blank\">意大利</a>(4.4万亿美元)。\r\n</p>', '95', '', '1', '管理员', '1472095995', '0', '1', '1', '1', '27;', '2', '22', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('173', '2016-0173', '\"国家又给东北1.6万亿\"系误读:非全额由国家投资', '<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	（原标题：1.6万亿？钱咋来？花在哪？怎么花？为啥花？）\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	近日，国家发展改革委印发了《推进东北地区等老工业基地振兴三年滚动实施方案（2016-2018年）》，分年度明确了137项重点工作和127项重大项目，在引发各方面高度关注的同时，出现了“国家又给了东北1.6万亿”等不太准确的解读。8月24日，围绕社会普遍关心的《实施方案》相关话题，中国经济导报、中国发展网记者独家专访了国家发展改革委振兴司有关负责人。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<strong>一问：1.6万亿？</strong>\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	振兴司有关负责人：所谓“国家又给东北1.6万亿”的解读，无论是从内容上还是数额上，都是片面解读甚至是误读。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	首先，《实施方案》的重点是2016-2018年拟实施的137项重大工作任务，这些任务立足于通过深化改革开放促进东北地区重振雄风，127项项目是配合这些任务的。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	其次，关于投资数额表述也并不准确，《实施方案》提出了拟于2016-2018年开工建设127项项目，这些项目是滚动实施的，估算总投资约有1万多亿，且并不是全部由国家投资的。\r\n</p>\r\n<p style=\"text-indent:2em;font-size:16px;font-family:宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<strong>二问：钱咋来？</strong>\r\n</p>', '95', '', '1', '管理员', '1472096287', '0', '1', '1', '1', '27;', '2', '6', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('174', '2016-0174', '55岁大叔扮乾隆皇帝骗走深圳富婆4000万：太狗血', '<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	一名55岁男子冒充金融业大拿并伙同另一名冒充乾隆皇帝的男子诈骗一名富婆超过4000万元！今日此案在深圳受审。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	自称操控海外3000多亿皇家基金还认识军方领导\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	万健民现年55岁，高中文化。检方指控显示，万健民谎称打过越南战争，曾担任江西省景德镇市税务局局长，帮国家领导打过金融战争，宋鸿兵写的《货币战争》也是由其命名。在万健民的描述中，他是国际上16级的金融家，曾在江西财经大学上学，学过外国的金融体系。他还是国际金融大鳄索罗斯的学生，师妹是索罗斯的老婆。他的家族掌握着加拿大的皇家银行，他则是掌门人，可以操控海外3000多亿美金的皇家基金，在金融圈人脉广泛。除此之外，他还认识很多中央以及军方领导。约在2012年左右，受害者郑雪菊想开办村镇银行，经人介绍认识了所谓金融业大拿万健民。同时，万健民还介绍郑雪菊认识了刘乾珍。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	谎称自己是乾隆皇帝吃了长生不老药\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	刘乾珍的身份则更为离奇，他谎称自己是乾隆皇帝，吃了长生不老药，活了300多岁，是全世界27个皇家家族子弟，掌握着大清皇家的大量资产。在法庭上出示的一份录音中，有被害者家属在与刘乾珍沟通时还指，“你有几百岁？这不科学啊。”万健民也谎称自己是万氏家族的第九代传人，只有他才能将皇家的钱解冻出来。被害人郑雪菊对此信以为真，被刘乾珍以运作皇家资金以及购买玉白菜为由骗取222万元。而这还仅仅是郑雪菊被骗的极小一部分。\r\n</p>\r\n<p style=\"font-size:14px;text-indent:30px;font-family:Simsun;background-color:#FFFFFF;\">\r\n	投资理财做诱饵、谎称能拿地她把老公的3000万也转走了\r\n</p>', '95', '', '1', '管理员', '1472096318', '0', '1', '1', '1', '27;', '2', '19', '', null, null);
