INSERT INTO `smeoa_notice` VALUES ('192', '2016-0192', '观天下：永暑礁成不沉航母 27座机库直戳美国软肋', '<span style=\"color:#555555;font-family:\'Microsoft YaHei\';font-size:14px;line-height:24px;background-color:#FFFFFF;\">2016年7月，菲律宾单方面提起的南海非法仲裁结束后，南海局势降温。美菲寄予厚望的“国际法”和软实力牌贻笑大方，被中国外交化解。自美国挑动萨德入韩，离间中韩蜜月，将亚太焦点转移到朝鲜半岛后，南海问题逐渐淡出视野，进入下一个博弈周期。这个阶段，中、美、日、俄、澳乃至欧洲的身影将出现于这片半封闭海域。中国是否应当制定清晰可行的南海之策？南海战略之于中国海洋战略的地位如何？凤凰军事《观天下》为您独家解读。</span>', '68', '743dd2cfdeca1089f63be66ca2c41ca7;', '1', '管理员', '1472103013', '0', '1', '1', '1', '27;', '', '0', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('193', '2016-0193', '[聚焦G20峰会8]杭州峰会将给G20带来哪些突破？', '<span style=\"color:#2B2B2B;font-family:SimSun;font-size:16px;line-height:30px;\">二十国集团（G20）领导人第十一次峰会将于9月4日至5日在杭州举行。中国希望通过举办杭州峰会实现以下目标：</span><strong>一是发挥G20的引领作用，体现战略远见和雄心，</strong><span style=\"color:#2B2B2B;font-family:SimSun;font-size:16px;line-height:30px;\">&nbsp;为世界经济指明方向，发掘动力；</span><strong>二是加强国际经济合作，发扬同舟共济的伙伴精神，</strong><span style=\"color:#2B2B2B;font-family:SimSun;font-size:16px;line-height:30px;\">&nbsp;共同应对风险和挑战，发出团结、开放、包容、合作的强有力信号；</span><strong>三是创新机制建设，打造合作平台，为G20从危机应对向长效治理机制转型提供坚实保障。</strong>', '68', 'd1cf16443acd146779eec63a78dfc576;', '1', '管理员', '1472103072', '0', '0', '1', '1', '27;', '', '0', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('194', '2016-0194', '男子将情人所产女婴送人 被捕后得知女儿非亲生', '<p style=\"font-family:宋体;font-size:14px;text-indent:30px;background-color:#FFFFFF;\">\r\n	去年7月份，在海南务工的四川民工刘某和情人一起，将自己出轨生下的“女儿”交给相交10多年的老朋友郑文宇抚养。几天后，在三亚干活的刘某接到郑文宇和另一男子的电话，让他一起到海口的派出所说明情况。随后，关于刘某涉嫌拐卖儿童罪的消息在刘某的老乡圈及老家传开。2016年8月22日，被羁押一年多的刘某出现在海口中院的被告席。对于海口美兰法院一审以拐卖儿童罪判处他有期徒刑1年6个月，刘某不服上诉。“坐完这一年半的牢我愿意，但这个罪我觉得憋屈。”□南国都市报记者何慧蓉\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;text-indent:30px;background-color:#FFFFFF;\">\r\n	<strong>男子出轨情人生下“女儿”</strong>\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;text-indent:30px;background-color:#FFFFFF;\">\r\n	<strong>将女婴送养情人收6万好处费</strong>\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;text-indent:30px;background-color:#FFFFFF;\">\r\n	刘某年近五十，只有小学文化的他学了木工活，这些年一直在外打工，妻子则在老家照顾两个孩子。独自在外，刘某在2014年年间与一名30多岁的女子赵某莲有了一段风流韵事。持续两三个月后，刘某与赵某莲分手。\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;text-indent:30px;background-color:#FFFFFF;\">\r\n	“分手后，她经常给我打电话说怀了我的孩子。”分手一年多后，赵某莲找上他，说不想和同居的男子于洋(化名)过了，女儿以后要给刘某抚养时，刘某有些慌了。在老家，刘某有妻儿，自己在外务工也不算很宽裕，要是把女婴抱回家，刘某不敢想象。思来想去，刘某觉得，自己可将这个婚外情生下的女儿送养，这样家里人就不会知道了。刘某想把孩子送给自己一个相交10多年的老朋友郑文宇。郑文宇经济条件不错，但多年未育。跟情人赵某莲商量后，赵某莲也同意将孩子送养，但提出要6万元“感谢费”。郑文宇看了女婴，觉得孩子确实可爱，最终同意给6万元。但怕以后有麻烦，郑文宇坚持让孩子的亲生父亲和母亲在收养协议上签名。\r\n</p>', '96', 'db2eaaf00a456a6fb530d1acb6bb2688;', '1', '管理员', '1472103222', '0', '0', '1', '1', '27;1;3;194;195;196;5;27;1;3;194;195;196;5;', '', '0', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('195', '2016-0195', '浙江长兴：县镇村“多管齐下”监督村级工程规范化建设', '<p style=\"font-size:14px;font-family:宋体;background-color:#FFFFFF;\">\r\n	8月24日，长兴县泗安镇纪委工作人员及村民代表在初康村在建的84户农民新村住宅工程现场查看工程进度及实施情况。\r\n</p>\r\n<p style=\"font-size:14px;font-family:宋体;background-color:#FFFFFF;\">\r\n	浙江省长兴县纪委依据“转职能、转方式、转作风”的工作要求，从2016年开始按照县、镇、村三级纪检检查部门“多管齐下”的方式，全面监督各个乡村村级工程规范化建设的推进情况，对于工程的招标、审计、验收及资金使用情况采用多级监管、不定时抽查的方式，实现村级工程建设廉政监督“全覆盖”，保障村级工程建设过程规范、透明、廉洁。新华社记者 徐昱摄\r\n</p>', '96', '16e7046c25112b45a9479435d6721f4f;', '1', '管理员', '1472103286', '0', '0', '1', '1', '27;1;3;194;195;196;', '', '0', '', null, null);
