INSERT INTO `smeoa_notice` VALUES ('210', '2016-0210', '最新企业概况', '<ul style=\"font-family:微软雅黑;font-size:medium;background-color:#FFFFFF;\">\r\n	<li>\r\n		<span class=\"ma1_01_1_span1\" style=\"font-size:40px;color:#424242;\">神洲创业&nbsp;聚创未来</span>\r\n	</li>\r\n	<li>\r\n		<span class=\"ma1_01_1_span2\" style=\"font-size:15px;color:#424242;font-weight:bold;line-height:25px;\">神洲创业,致力于为中国电商创客提供极具孵化力的服务空间整合运营方案。</span>\r\n	</li>\r\n	<li>\r\n		<p style=\"font-size:15px;color:#424242;\">\r\n			以市场化、专业化、集成化、网络化为发展原则，基于互联网与大数据，神洲创业充分整合中国电商创客群体的资本与知本，同时构建运营全流程服务平台，为政府、创客、服务商打造出低成本、便利化、全要素的良性互动环境。通过全方位运营服务支持，助力电商创客安心孵化，强势发展。\r\n		</p>\r\n	</li>\r\n</ul>', '68', 'ae192f03f3ce93d3708f9a3809f91137;170b076329ecf4fa04cc54fe2fb42008;', '1', '管理员', '1472179673', '0', '1', '1', '1', '27;', '', '0', '', null, null);
