INSERT INTO `smeoa_notice` VALUES ('212', '2016-0212', '神洲创业企业概况', '<span style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:19.5px;color:#3E3E3E;background-color:#F1EFEF;\">神洲创业为浙江神洲酷奇科技发展有限公司旗下的一个全新商业模式，基于九年间神洲酷奇对互联网及电子商务的行业知识、市场需求、线上渠道、上游供应、营销能力等多种资源的整合，致力于为中小微电商企业及个体，提供规范化的标准服务，聚合电商从业者，构建完善产业生态链，打造集创业孵化、统筹管理、资源整合等服务为一体的电子商务运营服务创新模式。</span><span style=\"color:#393939;font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;font-size:13px;line-height:19.5px;background-color:#F1EFEF;\"></span>\r\n<p style=\"font-family:\'Microsoft YaHei\', simsun, Arial, sans-serif;color:#393939;font-size:13px;background:white;\">\r\n	<span style=\"color:#3E3E3E;\">公司的总部位于美丽的西子湖畔杭州，服务创业的园区分布在杭州，宁波，金华，嘉兴等地。为了更好的服务于创业者，更多园区正在快速筹建中。</span>\r\n</p>', '68', '624d286c7cfd0f712dc79b95644f996f;', '1', '管理员', '1472191265', '0', '0', '1', '1', '27;', '', '0', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('213', '2016-0213', '女童被抓伤后打狂犬疫苗 打到第4针发现是消炎药', '<p style=\"text-align:left;color:#000000;text-indent:2em;background-color:#FFFFFF;\">\r\n	昨日，赵女士在华阴市岳庙街道办事处土洛坊村的娘家，提起孩子的遭遇就十分生气。\r\n</p>\r\n<p style=\"text-align:left;color:#000000;text-indent:2em;background-color:#FFFFFF;\">\r\n	她介绍说，7月27日上午，4岁独生女朵朵（化名）被邻居家狗抓伤，邻居积极处理，并就近让家人带着女儿到不远处的村卫生室接种疫苗（共要打5针）。\r\n</p>\r\n<p style=\"text-align:left;color:#000000;text-indent:2em;background-color:#FFFFFF;\">\r\n	8月9日，赵女士专程带孩子从渭南回到娘家，准备打第四针时，却被告知疫苗已用完，为了不错过接种时间，她让村卫生室负责人赵仓库写了处方。\r\n</p>\r\n<p style=\"text-align:left;color:#000000;text-indent:2em;background-color:#FFFFFF;\">\r\n	根据赵女士提供的一张处方笺的纸上所写，内容为头孢唑钠、注射用水和安痛定，并注明为肌注（即肌肉注射）。处方笺上没有署名，也没有写明时间。\r\n</p>\r\n<p style=\"text-align:left;color:#000000;text-indent:2em;background-color:#FFFFFF;\">\r\n	赵女士说，随后她带孩子到华阴市医院准备接种，但急诊科医生看了处方笺后表示：这只是消炎针，并非狂犬疫苗。\r\n</p>\r\n<p style=\"text-align:left;color:#000000;text-indent:2em;background-color:#FFFFFF;\">\r\n	“当时我就懵了，赵医生给我娃打的前三针到底是啥东西？”赵女士说，“我找到赵仓库询问，他说看朵朵情况不严重，所以给打了消炎针。”\r\n</p>\r\n<p style=\"text-align:left;color:#000000;text-indent:2em;background-color:#FFFFFF;\">\r\n	赵女士立即向华阴市卫计局举报。\r\n</p>\r\n<p style=\"text-align:left;color:#000000;text-indent:2em;background-color:#FFFFFF;\">\r\n	<strong>卫生部门：</strong>\r\n</p>', '95', '', '272', '胡庭', '1472191898', '0', '1', '1', '1', '27;', '2', '4', '', null, null);
