INSERT INTO `smeoa_notice` VALUES ('215', '2016-0215', '湖州迷妹请注意!前方谢霆锋出没', '<p style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	从第一季开始，《12道锋味》创新的节目形式就为观众所喜爱，每一季节目都给观众带来视觉上的至尊享受，本季节目耗费巨资在三里屯为喜爱“锋味”的观众们，打造了一家全新升级的豪华配置的锋味餐厅，不仅装修布置上都由谢霆锋本人亲自过问选材，精致到每一个细节，在餐厅食材上，谢霆锋还会把从世界各地搜集到的食材带回来亲自烹饪，并与观众、粉丝在“锋味餐厅”里进行互动交流，品尝不一样的大自然馈赠。这与百年老字号老恒和品牌想给消费者带来的味觉体验不谋而合，将老恒和产品 “纯天然酿造”的理念与节目探寻美食的本真完美契合，相信也会提升“老恒和”料酒品牌在观众们心目中的形象，矢志使老恒和成为消费者首选。\r\n</p>\r\n<p align=\"center\" style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<img title=\"湖州迷妹请注意!前方谢霆锋出没\" id=\"39436995\" style=\"border:0px currentColor;\" alt=\"湖州迷妹请注意!前方谢霆锋出没\" src=\"http://imge.gmw.cn/attachement/jpg/site2/20160824/f44d305ea5951927b3a51b.jpg\" />\r\n</p>\r\n<p style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	从美食出发，探索世界之美，开启新一轮的“由口入心”之旅，让每一道菜经过老恒和料酒的调配都能够散发天然本真的味道。当王牌综艺遇到王牌老恒和金字招牌，两者之间的合作堪称完美，相信有助于塑造精品品牌，将老恒和的味道传播的更加久远。\r\n</p>', '95', '', '111', '姚一飞', '1472191999', '0', '1', '1', '1', '27;', '2', '3', '', null, null);
