INSERT INTO `smeoa_notice` VALUES ('315', '2016-0312', '海曙区人社局局长陶宁一行参观指导神洲创业宁波电商园', '<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n	8月4日上午，宁波海曙区人社局陶宁局长、赵开宏副局长一行，到神洲创业宁波电商园及其仓储物流中心参观指导。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n	电商园总经理王元晨就园区的筹建和发展做了详细的汇报，表示园区将以一站式商业办公空间、安全智能仓储中心、金融服务中心、聚服务中心，为电商创客提供极具孵化力的服务空间整合运营方案。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0000pt;\">\r\n		陶局对神洲创业电商园的将电商产业集聚化的发展模式予以了肯定，并提出园区的发展离不开人才的发展，怎么样给人才提供合适的创业土壤、孵化平台，始终是园区需要去探索的。陶局同时表示，区人社局将在就业人才政策对接上给予园区充分支持。\r\n	</p>\r\n</p>', '95', '0b6b5f915a15650edcf99a4ada46e240;8edca16378e557021c5fce2a2a3a87b5;d2714dd132cf19612a7a4c2f51c2958e;', '1', '管理员', '1472547759', '0', '0', '1', '1', '27;', '2', '35', '', null, null);
