INSERT INTO `smeoa_notice` VALUES ('319', '2016-0316', '  习近平：按照时间表路线图推进改革', '新华社北京8月30日电 \r\n中共中央总书记、国家主席、中央军委主席、中央全面深化改革领导小组组长习近平8月30日上午主持召开中央全面深化改革领导小组第二十七次会议并发表重要\r\n讲话。他强调，当前和今后一个时期，是全面深化改革的施工高峰期，是落实改革任务的攻坚期，抓谋划、抓统筹、抓落实的任务依然艰巨繁重。要按照既定的时间\r\n表、路线图，更加注重发挥经济体制改革的牵引作用，更加有针对性解决各领域各层面各环节的矛盾和问题，强化基础支撑，注重系统集成，完善工作机制，严格督\r\n察落实，不断提高改革精准化、精细化水平，坚定不移把全面深化改革推向前进。\r\n<p style=\"font-size:16px;\">\r\n	中共中央政治局常委、中央全面深化改革领导小组副组长李克强、刘云山、张高丽出席会议。\r\n</p>\r\n<p style=\"font-size:16px;\">\r\n	会议审议通过了《关于构建绿色金融体系的指导意见》、《关于完善产权保护制度依法保护产权的意见》、《关于创新政府配置资源方式的指导意见》、《关于实行\r\n以增加知识价值为导向分配政策的若干意见》、《关于进一步推广深化医药卫生体制改革经验的若干意见》、《脱贫攻坚责任制实施办法》、《关于完善农村土地所\r\n有权承包权经营权分置办法的意见》、《重点生态功能区产业准入负面清单编制实施办法》、《生态文明建设目标评价考核办法》、《关于在部分省份开展生态环境\r\n损害赔偿制度改革试点的报告》、《关于从事生产经营活动事业单位改革的指导意见》、《关于公共文化设施开展学雷锋志愿服务的实施意见》、《关于清理规范改\r\n革试点情况的报告》、《关于全面深化改革重要举措出台和落实情况的评估报告》。\r\n</p>', '95', '', '1', '管理员', '1472636243', '0', '0', '1', '1', '27;', '2', '7', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('320', '2016-0317', '  李克强会见加拿大总理', '<strong>央视网消息</strong> (新闻联播)：国务院总理李克强30日下午在北京会见来华进行正式访问的<a href=\"http://country.huanqiu.com/canada\" class=\"linkAbout\" target=\"_blank\">加拿大</a>总理特鲁多。\r\n<p style=\"font-size:16px;\">\r\n	李克强表示，中加关系源远流长，两国友好深入人心。建交46年来，中加政治、经贸、人文等关系不断深化，各领域合作成果切实惠及两国人民。<a href=\"http://country.huanqiu.com/china\" class=\"linkAbout\" target=\"_blank\">中国</a>已成为加拿大第二大贸易伙伴、第二大进口来源地和第二大出口市场，两国关系与合作发展前景广阔。\r\n</p>\r\n<p style=\"font-size:16px;\">\r\n	李克强指出，中加都倡导多元文化，主张求同存异、互学互鉴、包容并蓄。我们愿同加拿大新政府一道把握好新机遇，打造中加关系新的发展时代，更好实现互利共赢，让两国友好薪火相传。\r\n</p>\r\n<p style=\"font-size:16px;\">\r\n	特鲁多表示，加新政府将秉承对华友好传统，愿同中方共同努力，深化加中关系和全方位务实合作，夯实业已扎根的深厚友谊，开创两国关系积极、稳定、强有力发展的新前景，促进两国乃至世界的和平与繁荣。\r\n</p>', '95', '', '1', '管理员', '1472636263', '0', '0', '1', '1', '27;', '2', '3', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('321', '2016-0318', '白银案刑警遗孀哭祭：你追了20年的人终于抓到了', '<p>\r\n	高承勇在8月27日落网的消息传出后，不大的白银沸腾了，困扰白银人多年的“噩梦”终于烟消云散。被生离死别折磨数年的被害人家属终于得到慰藉，穿\r\n上红衣、放鞭炮庆祝，而陪伴他们走过多年、参与侦破此案的老刑警们却是感慨良多。28年间，昔日年轻小伙已然满头银发，有人含恨退休，有人无奈调离，更有\r\n人带着遗憾早早离开人世，只因为当时白银案未破，不识凶手真面目。\r\n</p>\r\n<p>\r\n	北京晨报记者昨日独家采访到白银市公安分局原刑侦队长张国孝的遗孀王福芬，以及当时参与办案的刑警。在侦破过程中，全队上下，每个人的脸上都难见笑脸，气氛紧张压抑。\r\n</p>\r\n<p>\r\n	<strong>退休刑警：感觉不是欢快而是羞愧</strong>\r\n</p>', '95', '', '1', '管理员', '1472636287', '0', '0', '1', '1', '27;', '2', '7', '', null, null);
INSERT INTO `smeoa_notice` VALUES ('322', '2016-0319', '日媒:超五成日民众称安倍应对华采取更强硬姿态', '【环球网综合报道】<a href=\"http://country.huanqiu.com/japan\" class=\"linkAbout\" target=\"_blank\">日本</a>经济新闻社与东京电视台于8月26至28日实施了舆论调查，向日本民众询问了对日本首相安倍晋三外交姿态的看法。针对近期“<a href=\"http://country.huanqiu.com/china\" class=\"linkAbout\" target=\"_blank\">中国</a>公务船相继进入钓鱼岛附近海域”的态度，55%受访者表示，“应以更加强硬的姿态应对”。\r\n<p style=\"font-size:16px;\">\r\n	<strong>日本内阁阶层：62%受访者认为“应以更加强硬姿态应对”中国</strong>\r\n</p>\r\n报道称，中国公务船和渔船自8月上旬起，相继进入钓鱼岛附近日本主张所谓“领海”。在日本\r\n主张的“毗连区”的航行也趋于常态化，对此日本政府多次提出抗议。对于日本政府的对华姿态，在内阁支持阶层中，62%受访者认为“应以更加强硬的姿态应\r\n对”，自民党支持阶层中也63%的受访者持相同意见。而民进党支持阶层和公明党支持阶层更多受访者认为，“应更加重视对话”，但无党派阶层47%认为，', '95', '', '1', '管理员', '1472636310', '0', '0', '1', '1', '27;', '2', '16', '', null, null);
