INSERT INTO `smeoa_undoo_plan` VALUES ('41', '111', '1', '韩国《中央日报》25日称，虽然朝鲜的导弹技术正在取得快速进展，但安理会在这方面似乎显得“无能为力”。美日代表首先出了状况，都未出席当天的闭门磋商。美国常驻联合国代表正在休假，日本常驻联合国代表则在出差途中。鉴于美日连声明草案都没有提出，俄罗斯常驻联合国代表直接表态称，“美国无草案，会议无结果”。韩国政府相关人士认为，看来安理会要通过谴责朝鲜的声明，最快也要2-3天。', '1472195164');
